            <Globe className="h-4 w-4 mr-1" />
            {i18n.language === 'ko' ? 'EN' : '한국어'}
          </Button>
          <Button variant="ghost" size="sm" asChild>
            <a href="mailto:qhdtjr1004@naver.com">
